const playlistElement = document.getElementById("playlist");
const audioPlayer = document.getElementById("audioPlayer");
const searchInput = document.getElementById("searchInput");
const themeSelect = document.getElementById("themeSelect");
const audioInfo = document.getElementById("audioInfo");

// Affiche la playlist au chargement de la page
function loadPlaylist() {
  playlist.forEach((song, index) => {
    const li = document.createElement("li");
    li.innerHTML = `<strong>${song.title}</strong> - ${song.artist}`;
    li.dataset.theme = song.theme;
    li.addEventListener("click", () => playSong(index));
    playlistElement.appendChild(li);
  });
}

// Joue la chanson sélectionnée
function playSong(index) {
  const song = playlist[index];
  audioPlayer.src = song.src;
  audioPlayer.play();
  displayAudioInfo(song);
}

// Affiche les informations sur l'audio en lecture
function displayAudioInfo(song) {
  audioInfo.innerHTML = `<strong>الدرس:</strong> ${song.title} - <strong>الشيخ:</strong> ${song.artist} - <strong>التصنيف:</strong> ${song.theme}`;
}

// Filtrer la playlist en fonction de la recherche et du thème sélectionné
function filterPlaylist() {
  const searchTerm = searchInput.value.toLowerCase();
  const selectedTheme = themeSelect.value.toLowerCase();
  const lis = playlistElement.querySelectorAll("li");
  lis.forEach(li => {
    const title = li.textContent.toLowerCase();
    const theme = li.dataset.theme.toLowerCase();
    if (title.includes(searchTerm) && (selectedTheme === "" || theme === selectedTheme)) {
      li.style.display = "block";
    } else {
      li.style.display = "none";
    }
  });
}

// Filtrer la playlist lorsque la recherche ou le thème change
searchInput.addEventListener("input", filterPlaylist);
themeSelect.addEventListener("change", filterPlaylist);

// Charge la playlist au chargement de la page
window.addEventListener("load", loadPlaylist);
